description:
The Armed Conflict Location and Event Dataset (ACLED) summarizes press reports on conflict and protest events in Africa and parts of Asia. The relevant data can be accessed using the export tool at <a href = "https://www.acleddata.com/data/"target="_blank">https://www.acleddata.com/data/</a>:

- Set 'From' to the first day of the period of interest;
- Set 'To' to the last day of the period of interest;
- Set 'Country' to the country of interest;
- Click 'Export.'

The count of battle deaths for the period of interest is obtained by summing the 'fatalities' column for events in which 'event_type' is Battle. If the count crosses the highest answer bin threshold before the close date, the question will be closed retroactively with the crossing date as the end date of the question.

This question will be resolved by consulting the data source once each week sometime between 10:00 AM ET Wednesday and 4:00 PM ET Thursday, starting the Wednesday after the question close date and continuing once each week until the data are successfully retrieved.

This question will be resolved using event data collected by the International Maritime Organization (IMO). The relevant data can be accessed by creating a free âPublic Accountâ on the IMO's <a href="https://webaccounts.imo.org/Common/WebLogin.aspx?App=GISISPublic&ReturnUrl=https%3a%2f%2fgisis.imo.org%2fPublic%2fPAR%2fReports.aspx">Global Integrated Shipping Information System</a> and using the search page for <a href="https://gisis.imo.org/Public/PAR/Search.aspx">Reported Incidents of Piracy and Armed Robbery</a>. Using the drop-down and open fields in the search box, enter the following search criteria:
- 'Location of incident' 'is not' 'In port area';
- Click 'Add' (your search criteria will display above the search box); 
- 'Incident date' 'is between' 1 August 2019 and 30 September 2019;
- Click 'Add';
- 'Geographical area of incident' 'is' West Africa;
- Click 'Add';
- Click 'Search.'

The number of events is shown at the top of the table. This question will be resolved by consulting the data source once each week sometime between 10:00 AM ET Wednesday and 4:00 PM ET Thursday, starting 20 November 2019 and continuing once each week until data are successfully retrieved.

This question will be resolved using the United States Geological Survey's Earthquake Catalog (<a href="https://earthquake.usgs.gov/earthquakes/search/"target="_blank">https://earthquake.usgs.gov/earthquakes/search/</a>). To access the relevant data: 
- Set the Magnitude to a Custom Minimum equal to the magnitude of interest;
- Set the Date & Time to a Custom Start with the first day of interest and End to the last day of interest;
- Leave the UTC times to the default settings (00:00:00 & 23:59:59);
- Set Geographic Region to World;
- Click Search beneath Output Options.

The number of earthquakes displays in the top left Search Results window. If the count crosses the highest answer bin threshold before the close date, the question will be closed retroactively with the crossing date as the end date of the question. Because USGS often makes changes to its initial data (e.g. recorded magnitude), this question will be resolved by consulting the source between 10:00 AM and 4:00 PM ET on 2 December 2019. Resolution will be based on the value observed at the time of source consultation.

The Armed Conflict Location and Event Dataset (ACLED) summarizes press reports on conflict and protest events in Africa and parts of Asia. The relevant data can be accessed using the export tool at <a href = "https://www.acleddata.com/data/"target="_blank">https://www.acleddata.com/data/</a>: 
- Set 'From' to the first day of the period of interest; 
- Set 'To' to the last day of the period of interest; 
- Set 'Country' to the country of interest; 
- Click 'Export.' 

The question will resolve as "yes" if ACLED records any event for which:
- 'event_type' is "Violence against civilians" or "Explosions/Remote violence" AND; 
- 'actor2' includes "Civilians" AND;
- 'fatalities' is greater than 0.

If a qualifying event is recorded, the question will be closed retroactively with the date of the first event as the end date of the question. This question will be resolved by consulting the data source once each week sometime between 10:00 AM ET Wednesday and 4:00 PM ET Thursday, starting the Wednesday after the question close date and continuing once each week until the data are successfully retrieved.

