- Set 'From' to the first day of the period of interest; 
- Set 'To' to the last day of the period of interest; 
- Set 'Country' to the country of interest; 
- Click 'Export.'

The count of battle deaths for the period of interest is obtained by summing the 'fatalities' column for events in which 'event_type' is Battles. If the count crosses the highest answer bin threshold before the close date, the question will be closed retroactively with the crossing date as the end date of the question.

This question will be resolved by consulting the data source once each week sometime between 10:00 AM ET Wednesday and 4:00 PM ET Thursday, starting the Wednesday after the question close date and continuing once each week until the data are successfully retrieved.

This question will be resolved using the Multisensor Analyzed Sea Ice Extent - Northern Hemisphere (MASIE-NH) data reported by NOAA's National Snow & Ice Data Center (<a href="http://nsidc.org/data/masie"target="_blank">http://nsidc.org/data/masie</a>). To access the relevant data:
- Click the 'Download Data' button;
- Select 'Daily Sea Ice Extent Values: Comma Separated Values (CSV) file';
- Sea ice levels are recorded in the column for the relevant region. 

If the sea ice extent crosses the lowest answer bin threshold before the close date, the question will be closed retroactively with the crossing date as the end date of the question. This question will be resolved by consulting the data source once each week sometime between 10:00 AM ET Wednesday and 4:00 PM ET Thursday, starting the Wednesday after the question close date and continuing once each week until the data are successfully retrieved.

Google Trends tracks how often a particular search-term is entered relative to the total search-volume. Values represent search interest relative to the highest value for the given region and period of interest. A value of 100 is the peak popularity for the term during the period of interest. A value of 50 means that the term is half as popular. A score of 0 means there was not enough data for this term. This question will resolve as 'yes' if Google Trends shows a 50-point or greater increase of interest in the search term in one (1) day during the period of interest. To access the relevant data, from <a href= "https://trends.google.com/trends/explore"target="_blank">Google Trends</a>:
- Enter the search term of interest (as a 'Search term' not a 'Topic');
- Make sure 'Worldwide' is selected for the geographic area;
- Use the drop-down field to enter a 'Custom time range' corresponding to the period of interest;
- Click the down arrow in the top right of the 'Interest over time' chart to download the data to a CSV file.

This question will be resolved by consulting the data source once each week sometime between 10:00 AM ET Wednesday and 4:00 PM ET Thursday, starting the Wednesday after the question close date and continuing once each week until the data are successfully retrieved.Â

This question will be resolved using Privacy Rights Clearinghouse's Chronology of Data Breaches (<a href = "https://www.privacyrights.org/data-breaches"target="_blank">https://www.privacyrights.org/data-breaches</a>). To access the relevant data:
- Select 'Hacking or Malware (HACK)' as the type of breach;
- Click 'Search Data Breaches';
- Download the 'Data Breach File';
 -Count the number of entries, for all organizations, in which 'Date Made Public' falls in the month of interest (sort by 'Date Made Public', if necessary). 

If the count crosses the highest answer bin threshold before the close date, the question will be closed retroactively with the crossing date as the end date of the question. This question will be resolved by consulting the data source once each week sometime between 10:00 AM ET Wednesday and 4:00 PM ET Thursday, starting 30 June 2019 and continuing once each week until the data are successfully retrieved.

The question will be resolved using the "last" price for Bitcoin in U.S. dollars according to <a href="https://www.quandl.com/data/BITFINEX/BTCUSD-BTC-USD-Exchange-Rate" target="_blank">Quandl's aggregation of BITFINEX data</a>. To access the relevant data:

- Click on Table;
- Find the row where Date equals the date of interest;
- The answer will be under the "Last" column.

The Armed Conflict Location and Event Dataset (ACLED) summarizes press reports on conflict and protest events in Africa and parts of Asia. The relevant data can be accessed using the export tool at <a href = "https://www.acleddata.com/data/"target="_blank">https://www.acleddata.com/data/</a>: 
- Set 'From' to the first day of the period of interest; 
- Set 'To' to the last day of the period of interest; 
- Set 'Country' to the country of interest;
- Click 'Export.' 

The question will resolve as "yes" if ACLED records more than 15 events for which 'event_type' is Riots. If the count crosses the indicated threshold before the close date, the question will be closed retroactively with the crossing date as the end date of the question.

This question will be resolved by consulting the data source once each week sometime between 10:00 AM ET Wednesday and 4:00 PM ET Thursday, starting the Wednesday after the question close date and continuing once each week until the data are successfully retrieved.

Located in Argentina's NeuquÃ©n province, there is concern and controversy surrounding the development viability of Vaca Muerta, a large reserve of shale oil and gas (<a href = "http://ieefa.org/ieefa-report-argentinas-vaca-muerta-patagonia-fracking-plan-is-financially-risky-fiscally-perilous/"target="_blank">IEEFA</a>, <a href = "https://www.rystadenergy.com/newsevents/news/press-releases/Will-the-vast-potential-of-Argentinas-Vaca-Muerta-shale-play-ever-be-unlocked/"target="_blank">RystadEnergy</a>, <a href = "https://www.chron.com/business/energy/article/Argentina-looks-to-use-Vaca-Muerta-shale-play-to-13684909.php"target="_blank">Chron</a>, <a href = "https://www.forbes.com/sites/thebakersinstitute/2019/03/11/houston-we-dont-have-a-problem-pro-development-candidate-wins-the-battle-for-the-vaca-muerta/#124eeafd549a"target="_blank">Forbes</a>). This question will resolve according to data from the Argentinian Ministry of Treasury, located here: <a href = "https://www.argentina.gob.ar/energia/hidrocarburos/produccion-de-petroleo-y-gas"target="_blank">Treasury Data</a>. To access the data: 

- Click on âProducciÃ³n de PetrÃ³leo y Gas - desde 2009 (Sesco Web)â and download the zip file;
- Open the Excel file within the zip file;
- Open the âProducciÃ³n Oil m3â tab;
- Select â2019â as the âaÃ±oâ (year) and âNeuquÃ©nâ as the âprovinciaâ (province).

The monthly oil production total is located at the bottom of the column for the month of interest. For example, oil production in NeuquÃ©n totaled 563,983 m3 in August 2018. August 2019 data is expected to be published in October 2019.  This question will be resolved by consulting the data source once each week sometime between 10:00 AM ET Wednesday and 4:00 PM ET Thursday, starting on 2 October 2019 and continuing once each week until the data are successfully retrieved.

The Aid in Danger (AiD) project collects information on events that interfere with the delivery of humanitarian aid (<a href = "http://www.insecurityinsight.org/aidindanger/digests/"target="_blank">http://www.insecurityinsight.org/aidindanger/digests/</a>). To access the relevant report:
- Look under the header 'The Aid in Danger Monthly News Brief';
- Select 'The Aid in Danger Monthly News Brief' for the latest month of interest;
- Click 'Download.' 
The relevant data is listed in a table reporting the total number of aid workers reportedly affected during the period of interest in the 'Killed' and 'Kidnapped' columns. This question will be resolved by consulting the data source once each week sometime between 10:00 AM ET Wednesday and 4:00 PM ET Thursday, starting the Wednesday after the question close date and continuing once each week until the data are successfully retrieved.

This question will resolve as 'yes' if the Global Disaster Alert and Coordination System reports a Red tropical cyclone alert for India during the period of interest. To access the relevant data: 
- Go to <a href = "http://www.gdacs.org/Alerts/default.aspx"target="_blank">GDACS</a>;
- Click âSearchâ; 
- Select the event of interest; 
- Set 'From' to the first day of the period of interest; 
- Set 'To' to the last day of the period of interest; 
- Select âLevelâ to Red; 
- Click âSubmitâ.

Scroll down to the Results section below the map. If a Red alert is listed before the close date for the location of interest, the question will be closed retroactively with the date and time of the initial issuance of a qualifying red alert as the end date of the question.  To determine the date and time of the initial issuance of a qualifying event:
- Click the description of the initial qualifying event returned in the search as described above;
- Click on the âImpactâ tab;
- Scroll down to the âImpact Timelineâ table;
- Click on the blue down arrow (âvâ) below the âImpact Timelineâ table (this expands the table to show all alerts); 
- Identify the initial instance of a qualifying red alert within the âImpact Timelineâ table.

This question will be resolved using data from the UK's (<a href = "http://www.nationalcrimeagency.gov.uk/"target="_blank">National Crime Agency (NCA)</a>). To access the relevant data:
- Go to: <a href="https://nationalcrimeagency.gov.uk/who-we-are/publications"target="_blank">NCA Publications</a>; 
- Enter "National Referral Mechanism Statistics" in the 'Find by title or descriptionâ¦' field; 
- Click Search; 
- Locate and download the report for the period of interest.
The data are located in the 'NRM Statistics' section in the 'Claimed Exploitation Type' table for the period of interest. Data for this source is typically released 6 â 8 weeks after the end of the quarter. This question will be resolved by consulting the data source once each week sometime between 10:00 AM ET Wednesday and 4:00 PM ET Thursday, starting the Wednesday after the question close date and continuing once each week until the data are successfully retrieved.

The International Crisis Group's monthly bulletin, Crisis Watch, provides short, country-specific updates on political and security developments worldwide, assessing in each case whether the overall situation has deteriorated, improved, or remained unchanged. The question will resolve according to conflict status for the country of interest for the period of interest as reported within the International Crisis Groupâs Crisis Watch Map.  To access the relevant information:

- Go to <a href = "https://www.crisisgroup.org/crisiswatch"target="_blank"> https://www.crisisgroup.org/crisiswatch</a>;
- Click on 'BROWSE MAP';
- Click on the country of interest; 
- Hover over the lines at the top of the pop-up window for the status of the period of interest.

This question will be resolved by consulting the data source once each week sometime between 10:00 AM ET Wednesday and 4:00 PM ET Thursday, starting the Wednesday after the question close date and continuing once each week until the data are successfully retrieved.Â

Remittances are defined here as the transfer of small amounts of money from an individual in one country to an individual in another country. These remittances are often initiated by foreign workers in one country to an individual in their home country. The World Bank provides data on the <a href= "https://remittanceprices.worldbank.org/en" target= "_blank"> costs associated with transferring this money worldwide</a>. To access the relevant data:
- Go to <a href= "https://remittanceprices.worldbank.org/en/corridor/Saudi%20Arabia/Syria"target="_blank">https://remittanceprices.worldbank.org/en/corridor/Saudi%20Arabia/Syria</a>;
- Above the table, on the right side, set âCollection period forâ to the period of interest;
- Above the table, on the left side, set currency to âUSDâ;
- Click the â200.00 USDâ tab;
- Percentage cost is located in the âTotal cost (%)â column in the âTotal Averageâ row at the bottom of the table.

Note that the total average percent cost is the average cost of remitting on the âData collected onâ date at the top right of the table, not the average for the entire quarter. Â This question will be resolved by consulting the data source once each week sometime between 10:00 AM ET Wednesday and 4:00 PM ET Thursday, starting the Wednesday after the question close date and continuing once each week until the data are successfully retrieved. Â The question will be closed retroactively with the âData collected onâ date as the end date of the question.

