This question will be resolved using data from the European Patent Office. To access the relevant data:
- Go to <a href="https://worldwide.espacenet.com/"target="_blank">Espacenet</a>;
- Click on 'Advanced search' on the left of the page;
- Verify that 'Worldwide â collection of published applications from 100+ countries' is selected in the collection search drop-down at the top;
- Enter 'CN' in the 'Publication number' field;
- Enter the year and month of interest in YYYYMM format in the 'Publication date' field;
- Enter the IPC code of interest in the 'IPC' field;
- Click 'Search.'

The number of patents published is shown at the top of the 'Result list.'Â  If the count crosses the highest answer bin threshold before the close date, the question will be closed retroactively with the crossing date as the end date of the question. This question will be resolved by consulting the data source once each week sometime between 10:00 AM ET Wednesday and 4:00 PM ET Thursday, starting the Wednesday after the question close date and continuing once each week until the data are successfully retrieved.Â

