The Global Competitiveness Report is an annual report published by the World Economic Forum. Featuring the new Global Competitiveness Index 4.0, the report assesses the competitiveness landscape of 140 economies, providing unique insight into the drivers of economic growth in the era of the Fourth Industrial Revolution. This question will be resolved using the scores reported in The Global Competitiveness Report 2019. To access the relevant data:
- Go to <a href = "http://www.weforum.org/gcr"target="_blank">http://www.weforum.org/gcr</a>;
- Select the pillar of interest from the 'Index component' drop-down;
- Compare scores of countries of interest.
This question will be resolved by consulting the data source once each week sometime between 10:00 AM ET Wednesday and 4:00 PM ET Thursday, starting the Wednesday after the question close date and continuing once each week until the data are successfully retrieved.

