This question will be resolved using the closing value reported by Bloomberg for the date of interest.
- Go to <a href="https://www.bloomberg.com/quote/USDBRL:CUR"target="_blank">Bloomberg</a>;
- Click 'VIEW FULL CHART' above the chart on the right;
- Click the one month time frame '1M'.
Question will be closed the day before the date of interest.

This question will be resolved using data from the National Hurricane Center (NHC), National Oceanic and Atmospheric Administration (NOAA) Tropical Cyclone Reports. To access the relevant data:
- Go to <a href = "https://www.nhc.noaa.gov/data/tcr/"target="_blank">NHC Data</a>;
- Click on the year of interest;
- Click on 'Eastern Pacific';
- Click on each map (there may be more than one) at the bottom of the page and count the number of Major Hurricanes (annotated 'MH') whose date range falls within or overlaps with the period of interest. Major Hurricanes are those hurricanes reaching Category 3 and higher. If the number of hurricanes crosses the highest answer bin threshold before the close date, the question will be closed retroactively with the crossing date as the end date of the question. This question will be resolved by consulting the data source between 10:00 AM ET Wednesday and 4:00 PM ET Thursday starting on 24 July 2019.

