- Click on the 'Impact' tab;
- Scroll down to the 'Episode Timeline' table;
- If applicable, click on the blue down arrow ('v') below the 'Episode Timeline' table (this expands the table to show all alerts); 
- Identify the initial instance of a qualifying red alert within the 'Episode Timeline' table.

