This question will be resolved using the United States Geological Survey's Earthquake Catalog (<a href="https://earthquake.usgs.gov/earthquakes/search/"target="_blank">https://earthquake.usgs.gov/earthquakes/search/</a>). To access the relevant data: 
- Set the Magnitude to a Custom Minimum equal to the magnitude of interest;
- Set the Date & Time to a Custom Start with the first day of interest and End to the last day of interest;
- Leave the UTC times to the default settings (00:00:00 & 23:59:59);
- Expand the 'Advanced Options';
- Set Geographic Region to North=40, West=30, East=65, and South=10;
- Click Search beneath Output Options.
The number of earthquakes displays in the top left Search Results window. If the count crosses the highest answer bin threshold before the close date, the question will be closed retroactively with the crossing date as the end date of the question. Because USGS often makes changes to its initial data (e.g. recorded magnitude), this question will be resolved by consulting the source between 10:00 AM and 4:00 PM ET on 6 November 2019. Resolution will be based on the value observed at the time of source consultation.
